import React, {useState} from 'react'
function MyComp(){

const [name, setName] = useState('');

function changeName(event){
    return(
        <>
        setName(event.target.value); 
        </>
    )
}
    return(
        <>
        <input value={name} onChange={changeName}/>
        <p>Name: {name}</p>
        </>
    )
}

export default MyComp;
